import React from 'react';
import '../styles/PersonTable.css';

const PersonTable = ({ persons, onSort, sortConfig, onDelete }) => {
  const getSortIcon = (key) => {
    if (sortConfig.key !== key) return '‚ÜïÔ∏è';
    return sortConfig.direction === 'asc' ? '‚¨ÜÔ∏è' : '‚¨áÔ∏è';
  };

  const getGenreIcon = (genre) => {
    return genre === 'masculin' ? 'üë®' : genre === 'feminin' ? 'üë©' : 'üë§';
  };

  const getSituationIcon = (situation) => {
    const icons = {
      'celibataire': 'üíõ',
      'marie': 'üíç',
      'divorce': 'üíî',
      'veuf': '‚ö´'
    };
    return icons[situation] || '';
  };

  const getStatusIcon = (travail) => {
    return travail ? 'üíº' : 'üë§';
  };

  return (
    <div className="person-table-container">
      <table className="person-table">
        <thead>
          <tr>
            <th onClick={() => onSort('prenom')} className="sortable">
              Pr√©nom {getSortIcon('prenom')}
            </th>
            <th onClick={() => onSort('nom')} className="sortable">
              Nom {getSortIcon('nom')}
            </th>
            <th>Genre</th>
            <th>Situation</th>
            <th>T√©l√©phone</th>
            <th>Localisation</th>
            <th onClick={() => onSort('profession')} className="sortable">
              Profession/Formation {getSortIcon('profession')}
            </th>
            <th>Entreprise</th>
            <th>Statut</th>
            <th>Daara</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {persons.map(person => (
            <tr key={person.id} className={person.travail ? 'travail-row' : 'non-travail-row'}>
              <td className="person-name">
                <strong>{person.prenom}</strong>
              </td>
              <td className="person-name">
                <strong>{person.nom}</strong>
              </td>
              <td className="person-genre">
                {getGenreIcon(person.genre)}
              </td>
              <td className="person-situation">
                {getSituationIcon(person.situationMatrimoniale)}
              </td>
              <td className="person-phone">
                {person.telephone}
              </td>
              <td className="person-location">
                <div>{person.quartier}</div>
                <div className="location-detail">{person.region}, {person.pays}</div>
              </td>
              <td className="person-profession">
                {person.travail ? person.profession : person.formation}
              </td>
              <td className="person-entreprise">
                {person.entreprise || '-'}
              </td>
              <td className="person-status">
                <span className={`status-badge ${person.travail ? 'status-travail' : 'status-non-travail'}`}>
                  {getStatusIcon(person.travail)} {person.travail ? 'Travaille' : 'Recherche'}
                </span>
              </td>
              <td className="person-daara">
                {person.daara}
              </td>
              <td className="person-actions">
                {onDelete && (
                  <button 
                    onClick={() => onDelete(person.id, `${person.prenom} ${person.nom}`)}
                    className="delete-btn-table"
                    title="Supprimer"
                  >
                    üóëÔ∏è
                  </button>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PersonTable;
